import React from "react";
const Price=(props)=>{
return (
    <ul class="price">
    <li class="header">{props.package}</li>
    <li class="grey">`$ 9.99 / ${props.rate}`</li>
    <li>`${props.data} Storage`</li>
    <li>`${props.email} Email`</li>
    <li>10 Domains</li>
    <li>1GB Bandwidth</li>
    <li class="grey"><a href="#" class="button">Sign Up</a></li>
  </ul>
)
}
export default Price;
